import React from "react";
import {
  Typography,
  Box,
  Card,
  CardContent,
  CardActionArea,
} from "@material-ui/core";

const MyAccordian = (props) => {
  return (
    <>
      <div>
        <Box p={2}>
          <Card p={3}>
            <CardContent>
              <Typography>{props.question}</Typography>
              <Typography>{props.ans}</Typography>
            </CardContent>
          </Card>
        </Box>
      </div>
    </>
  );
};

export default MyAccordian;
